              'KPK OTT "TANGAN KANAN" BOBBY NASUTION\u00a0- Komisi Pemberantasan Korupsi (KPK) mengungkap kronologi Operasi Tangkap Tangan (OTT) di wilayah Sumatera Utara. Pelaksana Tugas Deputi Penindakan dan Eksekusi KPK Asep Guntur Rahayu mengatakan lembaga antirasuah itu melakukan dua OTT di wilayah Sumut pada Kamis malam, 26 Juni 2025. Kedua OTT terkait dugaan tindak pidana korupsi pada proyek pembangunan jalan di Dinas Pekerjaan Umum Penataan Ruang (PUPR) Sumut dan di Satuan Kerja Pembangunan Jalan Nasional (PJN) Wilayah 1 Sumut. "Sejak beberapa bulan lalu, ada informasi dari masyarakat kepada kami terkait dengan dugaan tindak pindak korupsi. Kemudian juga adanya infrastruktur di wilayah tertentu di Sumatera Utara kualitasnya memang kurang bagus sehingga diduga ada tindak pidana korupsi pada saat pembangunannya. Berbekal dari informasi tersebut kemudian KPK menurunkan tim dan memantau pergerakan," ungkap Asep saat konferensi pers di Gedung Merah Putih KPK, Jakarta, Sabtu, 28 Juni 2025. OTT pertama, kata dia, terkait empat proyek pembangunan jalan di Dinas PUPR Sumut. Rinciannya, preservasi dan rehabilitasi Jalan Simpang Kota Pinang \u2013 Gunung Tua tahun 2023, 2024, dan 2025. OTT kedua terkait dua proyek pembangunan jalan di Satker PJN, yaitu Jalan Sipiongot batas Labusel dan Jalan Hutaimbaru- Sipiongot. Total nilai keenam proyek tersebut Rp231,8 miliar. Kadis PUPR Sumut Ikut Terjaring Saat OTT, KPK menangkap lima orang. Mereka adalah Direktur Utama PT DNG Akhirun Efendi Siregar; Kepala Dinas PUPR Sumut Topan Obaja Putra Ginting; Kepala UPTD Gunung Tua Dinas PUPR Sumut Rasuli Efendi Siregar, merangkap Pejabat Pembuat Komitmen (PPK); PPK Satker PJN Heliyanto; dan Direktur PT RN Rayhan Dulasmi Pilang, anak Akhirudin. Topan sendiri merupakan Kadis PUPR Sumut yang disebut-sebut sebagai tangan kanan Gubernur Sumut Bobby Nasution. Topan baru saja dilantik Bobby sebagai Kadis PUPR Sumut pada 24 Februari 2025. Sebelumnya, dia menjabat sebagai Kepala Dinas Pekerjaan Umum atau Dinas Sumber Daya Air, Bina Marga dan Bina Konstruksi Kota Medan. Topan juga pernah duduk sebagai Pelaksana tugas Sekda Kota Medan. Posisi tersebut dijabat Topan ketika Bobby yang juga menantu Jokowi masih menjabat sebagai Wali Kota Medan. Kronologi Pengungkapan Pada 22 April 2025, kata Asep, Topan bersama Akhirudin, Rasuli, melakukan meninjau lokasi proyek pembangunan jalan di Desa Sipiongot. Topan kemudian memerintahkan Rasuli menunjuk Akhirudin sebagai rekanan penyedia proyek pembangunan jalan Sipiongot Batas Labusel dan jalan Hutaimbaru-Sipiongot. Penunjukan itu, kata Asep, tanpa melalui mekanisme dan ketentuan dalam proses pengadaan barang dan jasa. "Total nilai kedua proyek tersebut sebesar Rp157,8 miliar," ujar Asep. Akhirudin kemudian dihubungi Rasuli yang memberitahukan bahwa pada Juni 2025 akan tayang proyek pembangunan jalan. Dia meminta Akhirudin menindaklanjutinya dan memasukkan penawaran. "Pada tanggal 23 sampai 26 Juni 2025, KIR (Akhirudin) kemudian memerintahkan stafnya untuk berkoordinasi dengan RES (Rasuli) dan staf UPTD untuk mempersiapkan hal-hal teknis sehubungan dengan proses e-katalog," ujar Asep. Akhirudin bersama Rasuli dan staf UPTD kemudian mengatur proses e-katalog sehingga PT DGN menang proyek pembangunan jalan Sipiongot Batas Labusel. "Untuk proyek lainnya disarankan agar penayangan paket lainnya diberi jeda seminggu agar tidak terlalu mencolok," ungkap Asep. Saat pengaturan proses e-katalog di Dinas PUPR Sumut, kata dia, terjadi pemberian uang dari Akhirudin dan anaknya, Rayhan Dulasmi Pilang, kepada Rasuli melalui transfer rekening. "Selain itu juga diduga terdapat penerimaan lainnya oleh TOP (Topan) dari KIR dan RAY (Rayhan) melalui perantara," ujarnya. Asep juga menjelaskan kronologi dan konstruksi perkara terkait proyek pembangunan jalan di Satker PJN. Di proyek ini, terlibat antara lain Heliyanto, Akhirudin, dan Rayhan (Direktur PT RN)......Selengkapnya baca di www.kba.one.',
